import React from "react";
import {
  Button,
  RadioGroup,
  FormControl,
  FormLabel,
  Sheet,
} from "@mui/material";
export default function PageOne() {
  return (
    <div>
      <FormControl>
      <FormLabel color="primary">What is your goal?</FormLabel>
      <RadioGroup
        defaultValue="Lose Weight"
        size="lg"
        sx={{ gap: 1.5 }}
      ></RadioGroup>
    </FormControl>
    </div>
  );
}
